import React from "react";

function About() {
  return (
        <div className="mx-auto my-10 bg-gray-200 px-10 py-10 max-w-sm rounded shadow-lg">
            <h1 className="font-bold">Hello!</h1>
            <br></br>
           <p>Welcome to our library's webpage!
            Our goal is to provide a welcoming and inclusive space where everyone can access resources and information to support 
            their personal and professional growth.At our library, you'll find a wide range of books and genres to check out for free.
            Please help us grow our database by filling out our New Book Form and spreading the word about our website.</p>
        </div>
  );
}

export default About;
